import React from "react";
import {
    Form,
    Message,
    Button,
    Input,
    Container,
    Header,
} from "semantic-ui-react";
import { gql, useMutation } from "@apollo/client";

const CREATE_USER = gql`
    mutation createUser(
        $username: String!
        $email: String!
        $password: String!
    ) {
        createUser(
            options: { username: $username, email: $email, password: $password }
        ) {
            user {
                id
                username
                email
            }
            errors {
                message
            }
        }
    }
`;

function Register() {
    return <div></div>;
}

export default Register;
